import { useState, useEffect } from "react";
import axios from "axios";
import { Flex } from "antd";
import HcpTable from "./components/HcpTable";

const App = () => {
  const [hcpData, setHcpData] = useState(null);
  const [selectedTableRow, setSelectedTableRow] = useState(null);

  useEffect(() => {
    fetchHcps();
  }, []);

  const fetchHcps = async () => {
    // TODO abstract to api file
    const response = await axios.get("http://localhost:8000/hcps/");
    // TODO why await this?
    const data = response.data.hcps;
    console.log("DATA", data);
    setHcpData(data);
  };

  const handleSelectedTableRowChange = (selectedRecord) => {
    setSelectedTableRow(selectedRecord);
    console.log("selectedRecord", selectedRecord);
  };

  return (
    <Flex justify="center" align="center">
      <HcpTable data={hcpData} onSelectRow={handleSelectedTableRowChange} />
    </Flex>
  );
};

export default App;
